import React, { useContext, useState } from "react";
import styled from "styled-components";
import {
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  Row,
  Col,
  Button,
  ButtonGroup,
  Card,
  CardImg,
  Navbar,
  NavbarToggler,
  Collapse,
} from "reactstrap";
import { birthContext } from "../context/birth";
import { signinUpContext } from "../context/signinup";
import { observer } from "mobx-react-lite";
import Link from "next/link";
import ReactPixel from "react-facebook-pixel";
const linkStyle = {
  marginRight: "1rem",
};
const topnavbar = observer(({ req }) => {
  useEffect(() => {
    const options = {
      autoConfig: true, // set pixel's autoConfig
      debug: false, // enable logs
    };
    ReactPixel.init("712715535735010", options);
  }, []);
  const birthInfo = useContext(birthContext);
  const signInfo = useContext(signinUpContext);
  const [collapsed, setCollapsed] = useState(true);

  const toggleNavbar = () => setCollapsed(!collapsed);
  const TopNavBarTitleLogoMoblie = styled.span`
    font-size: 35pt;
    text-align: center;
    width: 100%;
  `;
  const TopNavBarLoginJoin = styled.span`
    font-size: 12pt;
    text-align: right;
    width: 100%;
  `;
  const HomeTitlePosition = styled.div`
    display: flex;
    justify-content: center;
  `;
  const TopNavBarItemText = styled(Link)`
    color: #333;
    font-size: 13pt;
    font-weight: bold;
    &:hover {
      color: #333;
      text-decoration: none !important;
    }
  `;

  const TopNavBarItemPosition = styled(Nav)`
    display: flex;
    justify-content: space-around;
    color: black;
  `;

  const TopNavBarPosition = styled.div`
    width: 100%;
    padding-top: 2%;
  `;

  const TopMenuBarSelectNavItemText = styled.span`
    font-weight: 700;
    font-size: 14pt;
  `;
  const ListPosition = styled(Row)`
    margin-right: 0;
  `;
  const logout = () => {
    signInfo.kakaoId = "";
    signInfo.name = "";
    signInfo.email = "";
    signInfo.password = "";
    signInfo.JoinOrNot = false;
    ReactPixel.track("로그아웃");
    console.log("logout");
  };
  const init = () => {
    /* birthInfo.dbName = "";
    birthInfo.birth_year = "";
    birthInfo.birth_total = "";
    birthInfo.birth_month = "";
    birthInfo.birth_day = "";*/

    ReactPixel.track("홈버튼 클릭");
  };
  const DeleteBorder = styled(Card)`
    border: 0;
    margin: 5%;
  `;
  const TopNavbarHomePosition = styled(NavbarBrand)`
    width: 90%;
  `;
  const TopNavbarHomePositionMoblie = styled(NavbarBrand)`
    width: 80%;
  `;
  const TopNavBarTitleLogo = styled.span`
    font-size: 40pt;
    margin-left: 10%;
  `;

  const NavBarOdd = styled(NavItem)`
    background: #2bd9fd;
  `;
  const NavBarEven = styled(NavItem)`
    background: #5feefd;
  `;
  return (
    <div>
      <Navbar color="faded" light>
        <TopNavbarHomePosition href="/" className="mr-auto">
          <HomeTitlePosition>
            <TopNavBarTitleLogo>
              <TopNavBarItemText href="/">
                <TopNavBarTitleLogoMoblie onClick={init}>
                  <img
                    top
                    width="100%"
                    src={require("./sajubaju.png")}
                    class="card-img-top"
                    alt="..."
                  />
                </TopNavBarTitleLogoMoblie>
              </TopNavBarItemText>
            </TopNavBarTitleLogo>
          </HomeTitlePosition>
        </TopNavbarHomePosition>
        <NavbarToggler onClick={toggleNavbar} className="mr-2" />
        <Collapse isOpen={!collapsed} navbar>
          <Nav navbar>
            <NavBarOdd>
              <NavLink>
                {signInfo.kakaoId === "" ? (
                  <TopNavBarItemText href="/signin">로그인</TopNavBarItemText>
                ) : (
                  <TopNavBarItemText href="/">
                    <span onClick={logout} outline color="info">
                      로그아웃
                    </span>
                  </TopNavBarItemText>
                )}
              </NavLink>
            </NavBarOdd>
            <NavBarEven>
              <NavLink>
                <TopNavBarItemText href="/simple">간편테스트</TopNavBarItemText>
              </NavLink>
            </NavBarEven>
          </Nav>
        </Collapse>
      </Navbar>
    </div>
  );
});

/*topnavbar.getInitialProps = async ({ req }) => {
  return req
    ? { from: "server" } // 서버에서 실행 할 시
    : { from: "client " }; // 클라이언트에서 실행 할 시
};*/

export default topnavbar;
